// flags from https://flagicons.lipis.dev/

export const FlagBtn = ({
    children = null,
    country = '',
    disabled = false,
    last = false,
    selectCountry = () => { }
}) => {
    return <li onClick={() => { !disabled && selectCountry(country) }}>
        <div className="flag-container">
            {children}
        </div>

        <div className={last ? '' : 'line'}></div>

        <style jsx>{`
            li {
                display: grid;
                cursor: ${disabled ? 'normal' : 'pointer'};
                transform: scale(.9);
                border-radius: .2em;
                transition: transform .3s;
                padding: .1em 0;
                padding-bottom: ${last ? '0' : '.1em'};
            }

            li:hover {
                transform: scale(${disabled ? '.9' : '.95'})
            }

            li.disabled {
                opacity: .5;
                background: var(--transparent-white);
            }
            .flag-container {
                display: grid;
                grid-template-columns: 1em auto;
                gap: .5em;
                height: 1.3/3em;
                align-items: center;
                justify-content: center;
                color: var(--white);
                font-weight: 600;
                font-size: .8em;
                background: ${disabled ? 'var(--transparent-white)' : ''};
                opacity: ${disabled ? '.5' : '1'};
                padding: .1em .6em;
                border-radius: .3em;
            }

            .flag-container::after {
                content: "${country}"; 
            }


            .line {
                width: 100%;
                height: 1px;
                background: var(--white);
                margin: .7em auto .1em;
            }

    
            @media (width < 400px) {
                .flag-container::after {
                    content: unset;
                }
            }
        `}</style>
    </li>
}

